import React, { Component } from 'react';


class Register extends Component{

    constructor(props){
        super(props);

        this.state = {
            firstName:"",
            lastName:"",
            email:"",
            password:"",
            confirmPassword:"",
            valid:false
        }

        this.getFirstName= this.getFirstName.bind(this)
        this.getLastName= this.getLastName.bind(this)
        this.getEmail= this.getEmail.bind(this)
        this.getPassword= this.getPassword.bind(this)
        this.getConfirmPassword= this.getConfirmPassword.bind(this)
    }

    commonChange(event) {
        this.setState({
            [event.target.name]: event.target.value
        });
    }

    submit = ()=>{
        console.log("firstname",this.state.firstName)
        console.log("lastname",this.state.lastName)
        console.log("email",this.state.email)
        console.log("password",this.state.password)
        console.log("confirm password",this.state.confirmPassword)
    }


    render(){
        return (
            <form>
                <label>
                 First Name:
                <br/>
                <input type="text" name="firstName" onChange={this.getFirstName}/>
                <br/>
                 Last Name:
                <br/>
                <input type="text" name="lastName" onChange={this.getLastName}/>
                <br/>
                Email:
                <br/>
                <input type="text" name="email" onChange={this.getEmail}/>
                <br/>
                Password:
                <br/>
                <input type="password" name="password" onChange={this.getPassword}/>
                <br/>
                Confirm Password:
                <br/>
                <input type="password" name="confirmPassword" onChange={this.getConfirmPassword}/>
                </label>
                <br/>
                <input type="submit" value="Submit" onClick={this.submit}/>
            </form>
        )
    }
}

export default Register;
